import Form from './styles/Form';

export default function SignIn() {
  return (
    <Form>
      <fieldset>
        <label htmlFor="email">Email</label>
        <input
          type="email"
          name="email"
          placeholder="Your email Address"
          autoComplete="email"
        />
      </fieldset>
    </Form>
  );
}
